import Delay from 'react-delay'
import './css/home.css';
import logo from './test2.png'


var Tesseract=window.Tesseract;
var words;





export default class Home extends Component {
  componentDidMount(){
    console.log("working");
    Tesseract
    .recognize(logo)
    .then(function(result){
      console.log(result);
      words=result;
    })
    console.log({words})
    }

  render() {
    if(words===null){
      return(
      <Delay
      wait={250}>
      <div>Working...</div>
     </Delay>
      )
    }
    else{
    return (
      <div className="homebox">

        <div>hi</div>
        <div>hi</div>
        <div>hi</div>
        <div>hi</div>
        <div>result:</div>
        <div>{words}</div>
        <div>hi</div>
      </div>
    )
  }
}
}
